Lou Qingxi, &quot;Chinese Gardens&quot; 
China Intercontinental Press | 2003 | ISBN: 7508503678 | 151 pages | PDF | 25 MB

Chinese Gardens is about the history and evolution, and the art and techniques of Chinese gardens and their architectures. The author compares the gardens with the appearance of natural landscapes and describes their meaning to the Chinese, and the Chinese peoples admiration of them. With b&amp;w and color pictures.
